						<div itemprop="articleBody">
		<p><strong style="line-height: 1.3em;">Indkaldelse til Årsmøde i Danske Kvindelige Lægers Forening</strong></p>
<p><strong>Tirsdag d. 22 april, 2014 </strong></p>
<p>&nbsp;</p>
<p>Kl.17.00</p>
<p>Auditoriet, Hovedvejen, Indgang 4</p>
<p>Frederiksberg Hospital,</p>
<p>Nordre Fasanvej 57</p>
<p>2000 Frederiksberg</p>
<p>1.Velkomst v. Birte Holm Sørensen</p>
<p>2.Uddeling af Agnethe Løvgreens Legat v. Kirsten Salado - Rasmussen</p>
<p>3.Indlæg af årets legatmodtagere, som kort vil præsentere deres projekter.</p>
<p>4.Orientering om foreningens større aktiviteter:</p>
<p>•IMWA Nordeuropæiske Regions Møde i Danmark 2014 v. Margit Niebuhr</p>
<p>•Referat fra KLF rejsen til Myanmar v. Kirsten Behnke</p>
<p>•Myanmar Projektet v. Birte Holm Sørensen</p>
<p>•Mentorordning/Cafemøder v. Liselotte og Sara</p>
<p>Efterfølgende vil der være et let traktement, inden der afholdes Generalforsamling</p>
<p>kl. 18:30 – 19:00.</p>
<p>På bestyrelsens vegne,</p>
<p>Birte Holm Sørensen</p>
<p>Hellerup d. 18 marts, 2014</p>	</div>

	
